import Expenses from "./components/Expenses";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Apply for Passport",
      amount: 150,
      date: new Date(2023, 1, 24),
    },
    {
      id: "e2",
      title: "Buy Sneakers",
      amount: 15000,
      date: new Date(2023, 1, 27),
    },
    {
      id: "e3",
      title: "Learn Machine Learning",
      amount: 0,
      date: new Date(2023, 1, 30),
    },
    { id: "e4", title: "Freelancing", amount: 0, date: new Date(2023, 2, 1) },
  ];

  return (
    <div>
      <Expenses expenses={expenses}></Expenses>
    </div>
  );
}

export default App;
